import { combineReducers } from "redux";
import user from "./user-reducer";
import poll from "./poll-reducer";
import poll_item from "./poll-item-reducer";

const reducer = combineReducers({
  user: user,
  poll: poll,
  poll_item: poll_item,
});

export default reducer;
